	add("matchlock", "{\"term\":\"matchlock\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Early type of firearm, using a smoldering piece of cord to fire the powder in the firing pan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, Rudyard Kipling, ‘Dray Wara Yow Dee’, \u0027Black and White\u0027, Folio Society 2004, vol. 1, p. 372\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I crept silently up the hill-road, but the fuse of my \u0027\u0027matchlock\u0027\u0027 was wetted with the rain, and I could not slay Daoud Shah from afar\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The gunlock used in such a weapon, having a slow smouldering match, see: slow match\", \"priority\":4}]}, \"synonyms\":{}}");

	add("matchmaking", "{\"term\":\"matchmaking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"compound match + making\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An attempt to make two people romantically interested in each other, especially an attempt to set up a date between people or to arrange a marriage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027: Harriet Beecher Stowe, \u0027Uncle Tom\u0027s Cabin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The marriage was highly approved of by Mrs. Shelby, who, with a little womanly complacency in \u0027\u0027match-making\u0027\u0027, felt pleased to unite her handsome favorite with one of her own class who seemed in every way suited to her\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027: \u0027The Gilmore Girls\u0027 (TV, episode 1.18\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Patty, your timing is excellent. There\u0027s Claude over there. Want me to do some \u0027\u0027matchmaking\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1815\u0027\u0027: Jane Austen, \u0027Emma\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I planned the match from that hour; and when such success has blessed me in this instance, dear papa, you cannot think that I shall leave off \u0027\u0027match-making\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A service aiming to bring together sellers and buyers or potential partners\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027: Eunice L. Watson and Arthur Cope Emlem, \u0027Matchmaking in Neighborhood Day Care: A Descriptive Study of the Day Care Neighbor Service\u0027 [http://books.google.com/books?vid\u003dISBN0876782012\u0026amp;id\u003d69dGcYLvw0UC\u0026amp;q\u003dmatchmaking\u0026amp;dq\u003dmatchmaking\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"there was evidence that they did provide information for day care \u0027\u0027matchmaking\u0027\u0027 to the potential users and givers of care\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The act or process of locating suitable players to take part in a multiplayer game session\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The manufacture of matches for kindling or burning\", \"priority\":12}]}, \"synonyms\":{}}");

	add("mateine", "{\"term\":\"mateine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|maté|ine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A xanthine alkaloid found in the maté plant, stereoisomeric with caffeine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("matelot", "{\"term\":\"matelot\", \"etymology\":{\"influencers\":[], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\"], \"text\":\"{{borrowing|fr|lang\u003den}}, from Middle dutch (ca. 1050-1350) \u0027mattenoot\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"sailor; also \u0026quot;mate;\u0026quot; boon companio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"date\u003d7 June page\u003d24|passage\u003dThere were no signs and no one quite knew how to navigate the museum, including, as it was Fleet Week, gaggles of boyish sailors all in their summer whites. It looked like a Frank Sinatra movie. A bunch of these \u0027\u0027matelots\u0027\u0027 surrounded a police officer, who said: \u0026quot;You guys are from the USS Cole? Thank you for your service. Want me to take you around?\u0026quot;}}Category:en:Nautical\", \"priority\":2}]}, \"synonyms\":{}}");

	add("matelote", "{\"term\":\"matelote\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stew made primarily with fish and wine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An old sailors\u0027 dance in double time, somewhat like a hornpipe\", \"priority\":2}]}, \"synonyms\":{}}");

	add("matelots", "{\"term\":\"matelots\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"date\u003d7 June page\u003d24|passage\u003dThere were no signs and no one quite knew how to navigate the museum, including, as it was Fleet Week, gaggles of boyish sailors all in their summer whites. It looked like a Frank Sinatra movie. A bunch of these \u0027\u0027matelots\u0027\u0027 surrounded a police officer, who said: \u0026quot;You guys are from the USS Cole? Thank you for your service. Want me to take you around?\u0026quot\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mateology", "{\"term\":\"mateology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027μάτη\u0027 (folly) + \u0027λόγος\u0027 (discourse) compare French \u0027matéologie\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A vain, unprofitable discourse or inquiry\", \"priority\":1}]}, \"synonyms\":{}}");

