	add("mateyness", "{\"term\":\"mateyness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|matey|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being matey, camaraderie, chumminess\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1952\u0027\u0027, \u0027w:Harper\u0027s Harper\u0027s Magazine\u0027, Volume 204, %22mateynesses%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22mateyness%22|%22mateynesses%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dc72sT-rWCIzJmAWCtvmmBA\u0026amp;redir_esc\u003dy page 38\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Lacking \u0027\u0027mateyness\u0027\u0027, he lacks also the true imperiousness which is sometimes an effective substitute for the common touch\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, w:David G. D. G. Compton, \u0027Nomansland\u0027, 2011, Orion Publishing, %22mateynesses%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dc72sT-rWCIzJmAWCtvmmBA\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"%22mateynesses%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Harriet didn′t answer. Fovas was a po-faced cow. She′d been right to distrust the \u0027\u0027mateyness\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027w:The London The London Magazine, %22mateynesses%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22mateyness%22|%22mateynesses%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dc72sT-rWCIzJmAWCtvmmBA\u0026amp;redir_esc\u003dy page 68\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In spite of our arguments, we had much in common, both suburban London boys from unambitious working-class families, and fell easily into a cockney \u0027\u0027mateyness\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, w:Paul Paul Theroux, \u0027The Tao of Travel: Enlightenments from Lives on the Road\u0027, %22mateynesses%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dc72sT-rWCIzJmAWCtvmmBA\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"%22mateynesses%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 100\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"He could not cook, drive a car, or use a typewriter, so he was helpless alone. Greene seemed to require the \u0027\u0027mateyness\u0027\u0027 of another person — his friend Michael Meyer, who traveled with him through the Pacific, or later in his life the priest Father Duran, who appears in \u0027Monsignor Quixote\u0027. Greene claimed to be manic depressive, sometimes suicidal, and lonely\", \"priority\":11}]}, \"synonyms\":{}}");

	add("maths", "{\"term\":\"maths\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Contraction of \u0027mathematics\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"always singular\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027 August 21, \u0027Girls can do \u0027\u0027maths\u0027\u0027 as well as boys\u0027, \u0027w:New New Scientist\u0027, [http://books.google.com.au/books?id\u003dZUwz_1Gyj-oC\u0026amp;pg\u003dPA586\u0026amp;dq\u003d%22maths%22+-intitle:%22maths%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dzietT57LKKiuiAexieyGCQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22maths%22%20-intitle%3A%22maths%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 586\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The conventional “commonsense” view now is that girls are conditioned both by family and teachers to believe that \u0027\u0027maths\u0027\u0027 is a subject at which males excel, and that they believe they cannot be expected to comprehend its subtleties — so they don′t\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Miraca U.M. Gross, \u0027Exceptionally Gifted Children\u0027, [http://books.google.com.au/books?id\u003dIPPO-a_UWOIC\u0026amp;pg\u003dPA229\u0026amp;dq\u003d%22maths%22+-intitle:%22maths%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dzietT57LKKiuiAexieyGCQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22maths%22%20-intitle%3A%22maths%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 229\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"At age 10, Ian was based with the Grade 6 students but was allowed to take \u0027\u0027maths\u0027\u0027 with Grade 10 – a four-year grade advancement\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Clifford Matthews, \u0027IMechE Engineers′ Databook\u0027, Fourth edition, John Wiley \u0026amp; Sons, [http://books.google.com.au/books?id\u003doCJ13TSrf98C\u0026amp;pg\u003dPA40\u0026amp;dq\u003d%22maths%22+-intitle:%22maths%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dzietT57LKKiuiAexieyGCQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22maths%22%20-intitle%3A%22maths%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 40\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Most people who are forced to use \u0027\u0027maths\u0027\u0027 have little idea what it is really about\", \"priority\":10}]}, \"synonyms\":{}}");

	add("mathematician", "{\"term\":\"mathematician\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Of Middle french (ca. 1400-1600) \u0027mathematicien\u0027 from \u0027mathematique\u0027 of Latin \u0027mathematicus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An expert on mathematics\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mathematics", "{\"term\":\"mathematics\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|mathematique}}, from Latin {{m|la|mathēmatica||mathematics}}, from Ancient greek (to 1453) {{m|grc|μαθηματικός||fond of learning}}, from {{m|grc|μάθημα||knowledge, study, learning}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An abstract representational system used in the study of numbers, shapes, structure, change and the relationships between these concepts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, David Salsburg, \u0027The Lady Tasting Tea: How Statistics Revolutionized Science in the Twentieth Century\u0027, page\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In many cases, the \u0027\u0027mathematics\u0027\u0027 involved are deep and complicated\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Ian Stewart, \u0027Does God Play Dice?: The New Mathematics of Chaos\u0027, page 3\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The answer is \u0027yes\u0027, and the \u0027\u0027mathematics\u0027\u0027 needed is the theory of probability and its applied cousin, statistics\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A person\u0027s ability to count, calculate, and use different systems of mathematics at differing levels\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"My \u0027\u0027mathematics\u0027\u0027 is not very good\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Their \u0027\u0027mathematics\u0027\u0027 are not very good\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Their \u0027\u0027mathematics\u0027\u0027 is not very good\", \"priority\":9}]}, \"synonyms\":{}}");

	add("mathesis", "{\"term\":\"mathesis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027mathesis\u0027 Middle french (ca. 1400-1600) \u0027\u0027 and their source, \u0027mathesis\u0027 (astrology, liberal arts, science) from Ancient greek (to 1453) \u0027μάθησις\u0027 (learning) from the same base as \u0027μανθάνω\u0027 (i learn)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Mental calculation or discipline; science, especially mathematical learning\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Thomas Pynchon, \u0027Mason \u0026amp; Dixon\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Forget the Boys, forget your loyalties to your Dead, first of all to Rebekah, for she, they, are but distractions, temporal, flesh, ever attempting to drag the Uranian Devotee back down out of his realm of pure \u0027\u0027Mathesis\u0027\u0027, of that which abides\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The science of establishing a systematic order for things. (After Foucault\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Chris Horrocks\u0026lt;!-- illustrated by Zoran Jevtic --\u0026gt;, \u0027Introducing Foucault\u0027, page 69 (Totem Books, Icon Books; ISBN 1840460865\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I’m using \u0027\u0027\u0027mathesis\u0027\u0027\u0027 — a universal science of \u0027\u0027measurement\u0027\u0027 and \u0027\u0027order\u0027\u0027 […\", \"priority\":6}]}, \"synonyms\":{}}");

	add("mathetics", "{\"term\":\"mathetics\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Uncertian. Possibly from Ancient greek (to 1453) \u0027μαθητικός\u0027 (lang\u003dgrc) or from {{suffix|mathesis|etic|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of learning\", \"priority\":1}]}, \"synonyms\":{}}");

	add("matinee", "{\"term\":\"matinee\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027matinée\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A showing of a movie or theatrical performance in the afternoon\", \"priority\":1}]}, \"synonyms\":{}}");

