	add("matriarch", "{\"term\":\"matriarch\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Latin via or reinforced by Old french (842-ca. 1400) {{m|fro|matriarche}}, from \u0027māter\u0027 (mother) + {{m|la|-archa}}, {{m|la|-arches}}, from Ancient greek (to 1453) {{m|grc|-άρχης}}, from {{m|grc|ἀρχός||chief}}, ultimately from Proto-indo-european {{m|ine-pro|*arkhein||to begin, rule, command}}. Surface analysis {{confix|matri|arch|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female leader of a family, a tribe or an ethnic or religious group\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The dominant female in a family group of elephant\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A female founder of a political or religious movement, an organization or an enterprise\", \"priority\":3}]}, \"synonyms\":{}}");

	add("matric", "{\"term\":\"matric\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The final year of high school\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Someone in their final year of high school\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, \u0027A Dry White Season\u0027, Vintage 1998, p. 37\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Once, when some money disappeared […], it was Ben who took the cleaner under his wing and instituted inquiries which revealed a group of \u0027\u0027matric\u0027\u0027 boys to be the culprits\", \"priority\":4}]}, \"synonyms\":{}}");

	add("matriotism", "{\"term\":\"matriotism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A blend of alma mater and patriotism, later reanalyzed as derived from matri- by analogy with patriotism\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Hometown, school, or parish pride or loyalty, as opposed to nationalism or patriotis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"But though Mr. Lang\u0027s \u0027\u0027matriotism\u0027\u0027 is thus divided, he has only one fatherland, [Scotland,] and to that he is faithful against the world\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Love or celebration of a woman\u0027s influence upon society; a women\u0027s equivalent to male patriotis\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Matriotism\u0027\u0027 of household economics needs to be recognized as necessary for the whole of society\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Love of the motherland, as opposed to patriotism as love of the fatherland\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Pacifist patriotism; love of society as opposed to love of the stat\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a Matriot would never send her child or another mother’s child to fight nonsense wars. She would march into war herself to protect her child from harm. Patriots cower behind the flag and send young people to die for the sake of material wealth\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Devotion to Mother Earth, ecology, sustainability, peace and the survival of the human species as long as possible\", \"priority\":8}]}, \"synonyms\":{}}");

	add("matriphagy", "{\"term\":\"matriphagy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027matri-\u0027 (mother) and the suffix \u0027-phagy\u0027 (to feed on)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition where organisms feed on their own mother\", \"priority\":1}]}, \"synonyms\":{}}");

	add("matrix", "{\"term\":\"matrix\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027matrice\u0027 (pregnant animal) from Latin \u0027mātrīx\u0027 (dam, womb) from \u0027māter\u0027 (mother)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The womb\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1646\u0027\u0027, Sir Thomas Browne, \u0027Pseudodoxia Epidemica\u0027, III.17\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"upon conception the inward orifice of the \u0027\u0027matrix\u0027\u0027 exactly closeth, so that it commonly admitteth nothing after\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, Vladimir Nabokov, \u0027Ada or Ardor\u0027, Penguin 2011, p. 296\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In very rare cases, when the \u0027\u0027matrix\u0027\u0027 just goes on pegging away automatically, the doctor can take advantage of that and ease out the second brat who then can be considered to be, say, three minutes younger\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The material or tissue in which more specialized structures are embedded\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An extracellular matrix, the material or tissue between the cells of animals or plants\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Part of the mitochondrion\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The medium in which bacteria are cultured\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A rectangular arrangement of numbers or terms having various uses such as transforming coordinates in geometry, solving systems of linear equations in linear algebra and representing graphs in graph theory\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A two-dimensional array\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The circuitry inside a keyboard that determines which keys are being pressed\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A table of data\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A geological matrix, the outer material of a rock consisting of larger grains embedded in a material consisting of smaller ones\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The sediment surrounding and including the artifacts, features, and other materials at a site\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The environment from which a given sample is taken\", \"priority\":16}]}, \"synonyms\":{}}");

	add("matrixism", "{\"term\":\"matrixism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|matrix|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A minor modern religion based on w:The Matrix \u0027The Matrix\", \"priority\":1}]}, \"synonyms\":{}}");

	add("matron", "{\"term\":\"matron\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027matrone\u0027 Latin \u0027matrona|lang\u003dla\u0027 () from \u0027mater|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mature woman; a wife or a widow, especially, one who has borne children; a woman of staid or motherly manners\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c.1564–1616\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"your wives, your daughters, your \u0027\u0027matrons\u0027\u0027, and your maid\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1606-1661\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"grave from her cradle, insomuch that she was a \u0027\u0027matron\u0027\u0027 before she was a mothe\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"“A tight little craft,” was Austin’s invariable comment on the \u0027\u0027matron\u0027\u0027; and she looked it, always trim and trig and smooth of surface like a converted yacht cleared for action. \u0026amp;para; Near her wandered her husband, orientally bland, invariably affable\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A housekeeper; especially, a woman who manages the domestic economy of a public institution; a head nurse in a hospital\", \"priority\":7}]}, \"synonyms\":{}}");

	add("matronym", "{\"term\":\"matronym\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From mater \u0026quot;mother\u0026quot; + -onym \u0026quot;name\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The name of someone\u0027s mother\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A matronymic surname\", \"priority\":2}]}, \"synonyms\":{}}");

