	add("matryoshka", "{\"term\":\"matryoshka\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\", \"Russian\"], \"text\":\"From Russian \u0027матрёшка\u0027 from personal name \u0027матрёна\u0027 formerly \u0027матрона\u0027 ultimately from Latin {{m|la|mātrōna||matron}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of a set of wooden Russian dolls of different sizes, designed such that each fits inside the next\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0027Vanished Kingdoms\u0027, Penguin 2012, p. 35\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The past is not only a foreign country that we half knew existed; it is hiding another concealed country behind it, and behind that one, another, and another – like a set of Russian \u0027\u0027\u0027matryoshki\u0027\u0027\u0027, in which larger dolls conceal smaller\", \"priority\":3}]}, \"synonyms\":{}}");

	add("matsutake", "{\"term\":\"matsutake\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Japanese\"], \"text\":\"From Japanese \u0027松茸\u0027 (matsutake, literally, pine mushroom)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|righ\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A kind of mushroom, \u0027Tricholoma matsutake\", \"priority\":2}]}, \"synonyms\":{}}");

	add("matte", "{\"term\":\"matte\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027mat\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A decorative border around a pictur\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The image is a perfect square of 8 cm (with white \u0027\u0027matte\u0027\u0027 border the total dimensions are 14 cm tall by 11 cm wide\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A background, often painted or created with computer\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Matte\u0027\u0027 painting is a tool that filmmakers can use to create a scene that is either too impractical, too costly or simply too impossible to achieve with conventional cinematographic means\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The molten metal sulfide phases typically formed during smelting of copper, nickel, and other base metals\", \"priority\":5}]}, \"synonyms\":{}}");

	add("mattathias", "{\"term\":\"mattathias\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"ancient hebrew\", \"Latin\"], \"text\":\"From the Latin {{m|la|Mattathiās}}, from the Ancient greek (to 1453) {{m|grc|Μᾰττᾰθῐ́ᾱς}}, from the Ancient hebrew {{m|he|מַתִּתְיָהוּ|tr\u003dmattiṯyāhū}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The son of and father of , six-times-great–grandfather of Jesus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1582\u0027\u0027, \u0027w:Douay–Rheims The Nevv Teſtament of Ieſus Chriſt, tranſlated faithfully into Engliſh, out of the authentical Latin\u0027 (first edition), w:Gospel of The Holy Goſpel of Ieſus Chriſt according to Luke iii:25 (page 144\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"vvho vvas of \u0027\u0027Matthathias\u0027\u0027, vvho vvas of Amos, vvho vvas of Naum, vvho vvas of Heſli, vvho vvas of Naggé\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The son of and father of , twelve-times-great–grandfather of Jesus\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1582\u0027\u0027, \u0027w:Douay–Rheims The Nevv Teſtament of Ieſus Chriſt, tranſlated faithfully into Engliſh, out of the authentical Latin\u0027 (first edition), w:Gospel of The Holy Goſpel of Ieſus Chriſt according to Luke iii:26 (page 144\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"vvho vvas of Mahath, vvho vvas of \u0027\u0027Matthathias\u0027\u0027, vvho vvas of Semei, vvho vvas of Ioſeph, vvho vvas of Iuda\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A Jewish priest featured in the second chapter of , instigator of the and progenitor of the\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1610\u0027\u0027, \u0027w:Douay–Rheims The ſecond tome of the Holie Bible faithfully tranſlated into Engliſh, out of the authentical Latin\u0027 (first edition), w:1 The Firſt Booke of Macabees ii:1–5 (page 896\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"In thoſe dayes aroſe \u0027\u0027Mathathias\u0027\u0027 the ſonne of Iohn, the ſonne of Simeon, prieſt of the ſonnes of Ioarib from Ieruſalem, and he ſate in the mountayne of Modin: and he had fiue ſonnes, Iohn who was ſurnamed Gaddis: and Simon, who was ſurnamed Thaſi: and Iudas, who was called Machabeus: and Eleazar, who was ſurnamed Abaron: and Ionathan, who was ſurnamed Apphus\", \"priority\":9}]}, \"synonyms\":{}}");

	add("matter", "{\"term\":\"matter\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027mater\u0027 from Anglo-norman \u0027materie\u0027 from Old french (842-ca. 1400) \u0027materie\u0027 from Latin \u0027materia\u0027 (matter, stuff, material) derivative of Latin \u0027mater\u0027 (mother) Displaced native Middle english (1100-1500) \u0027andweorc\u0027 (from Old english (ca. 450-1100) \u0027andweorc\u0027 (matter, substance, material) , Old english (ca. 450-1100) \u0027intinga\u0027 (matter, affair, business)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Substance, material\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The basic structural component of the universe. Matter usually has mass and volume\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Matter made up of normal particles, not antiparticles. (Non-antimatter matter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A kind of substance\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Written material (especially in books or magazines\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Aristotelian: undeveloped potentiality subject to change and development; formlessness. \u0027Matter\u0027 receives , and becomes\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A condition, subject or affair, especially one of concern\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1561-1626\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"if the \u0027\u0027matter\u0027\u0027 should be tried by due\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Son of God, Saviour of men! Thy name / Shall be the copious \u0027\u0027matter\u0027\u0027 of my song\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Bible, xviii. 2\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Every great \u0027\u0027matter\u0027\u0027 they shall bring unto thee, but every small \u0027\u0027matter\u0027\u0027 they shall judge\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d8|passage\u003dThe humor of my proposition appealed more strongly to Miss Trevor than I had looked for, and from that time forward she became her old self again;. Now she had come to look upon the \u0027\u0027matter\u0027\u0027 in its true proportions, and her anticipation of a possible chance of teaching him a lesson was a pleasure to behold\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"12 July 2012\u0027\u0027, Sam Adams, AV Club \u0027Ice Age: Continental Drift\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027matter\u0027\u0027 of whether the world needs a fourth Ice Age movie pales beside the question of why there were three before it, but Continental Drift feels less like an extension of a theatrical franchise than an episode of a middling TV cartoon, lolling around on territory that’s already been settled\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"An approximate amount or extent\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"No small \u0027\u0027matter\u0027\u0027 of British forces were commanded over sea the year before\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"1616-1704\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Away he goes,a \u0027\u0027matter\u0027\u0027 of seven miles\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"1670-1729\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"I have thoughts to tarry a small \u0027\u0027matter\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"The essence; the pith; the embodiment\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"1572-1637\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"He is the \u0027\u0027matter\u0027\u0027 of virtue\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"Inducing cause or reason, especially of anything disagreeable or distressing\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"And this is the \u0027\u0027matter\u0027\u0027 why interpreters upon that passage in Hosea will not consent it to be a true story, that the prophet took a harlot to wife\", \"priority\":29}]}, \"synonyms\":{}}");

	add("matthew", "{\"term\":\"matthew\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Hebrew\", \"Latin\"], \"text\":\"From earlier \u0027matheu\u0027 from Old french (842-ca. 1400) \u0027mathieu\u0027 from Latin \u0027matthaeus\u0027 from Ancient greek (to 1453) \u0027ματθαῖος\u0027 from Hebrew \u0027מַתִּתְיָהוּ\u0027 meaning \u0026quot;gift of the Lord\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"of biblical origin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1771\u0027\u0027 w:Tobias Tobias George Smollett, \u0027The Expedition of Humphry Clinker\u0027, Harper\u0026amp;Brothers 1836, page 231\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"My name is \u0027\u0027Matthew\u0027\u0027 Bramble, at your service. The truth is, I have a foolish pique at the name of \u0027\u0027Matthew\u0027\u0027, because it savours of those canting hypocrites, who in Cromwell\u0027s time, christened all their children by names taken from the Scripture.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027 w:Charles Charles Kuralt, Dateline America, Harcourt Brace Jovanocich, ISBN 0151239576, page 184\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"People with incorruptible names like \u0027\u0027Matthew\u0027\u0027 are always calling people named Charles, Charlie. I wish my folks had named me \u0027\u0027Matthew\u0027\u0027. Matt is the worst that can be made of it\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"w:Matthew the Matthew the Evangelist, one of the twelve Apostles. A publican or tax-collector at Capernaum and credited with the authorship of the Gospel of Matthew\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"And as Jesus passed forth from thence, he saw a man, named \u0027\u0027Matthew\u0027\u0027, sitting at the receipt of custom: and he saith unto him, Follow me. And he arose, and followed him\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The Gospel of St. Matthew, the first book of the New Testament of the Bible. Traditionally the first of the four gospels, a book attributed to Matthew the Evangelist\", \"priority\":8}]}, \"synonyms\":{}}");

	add("matthias", "{\"term\":\"matthias\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Hebrew\", \"Latin\"], \"text\":\"From Latin {{m|la|Matthias}}, from Ancient greek (to 1453) {{m|grc|Ματθαῖος}}, from Hebrew {{m|he|מַתִּתְיָהוּ|tr\u003dmattiṯyā́hū}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Apostle chosen to replace Judas Iscariot. Category:en:Biblical character\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"derived from the same source as Matthew\", \"priority\":2}]}, \"synonyms\":{}}");

	add("matting", "{\"term\":\"matting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"mats, a collection of ground covering\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1846,\u0027\u0027 Herman Melville, \u0027Typee\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His departure oppressed me with melancholy, and, re-entering the dwelling, I threw myself almost in despair upon the \u0027\u0027matting\u0027\u0027 of the floor\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"coarse fabric, of the kind used to make mat\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"c. 1771\u0027\u0027 James Cook, \u0027First Voyage Round the World\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"the sails are of \u0027\u0027Matting\u0027\u0027 and are made narrow at the head and Square at the foot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Besides Cloth they [Tahitians] make several different sorts of \u0027\u0027matting\u0027\u0027, both better and finer than any we have in Europe; the stuff they make it on is the Produce of the Palm tree\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a dull surface, often used for surrounding pictures; matte\", \"priority\":8}]}, \"synonyms\":{}}");

	add("mattress", "{\"term\":\"mattress\", \"etymology\":{\"influencers\":[], \"languages\":[\"Arabic\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) \u0027materas\u0027 from Old french (842-ca. 1400) from Arabic \u0027مَطْرَح\u0027 (place where something is thrown) from \u0027طَرَحَ\u0027 (to throw) Compare {{m|en|divan}}, from Persian via Turkish.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pad on which a person can recline and sleep, usually having an inner section of coiled springs covered with foam or other cushioning material then enclosed with cloth fabric\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A form of retaining wall used to support foundations or an embankment\", \"priority\":2}]}, \"synonyms\":{}}");

