	add("maturity", "{\"term\":\"maturity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|mature|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being mature, ready or rip\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Some foods and drinks, like wine, only reach their full taste at \u0027\u0027maturity\u0027\u0027, which literally comes at a pric\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When bodily growth has completed and/or reproduction can begi\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The entire tank of guppies was in their \u0027\u0027maturity\u0027\u0027 and ready to mate\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Some insect species reach sexual maturity well before their own bodily maturit\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Date when payment is du\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The note was cashed at \u0027\u0027maturity\", \"priority\":7}]}, \"synonyms\":{}}");

	add("matzoon", "{\"term\":\"matzoon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|hy|մածուն|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A yoghurt-like dairy product, made from fermented cow\u0027s milk in Armenia and Georgia, of Armenian origin\", \"priority\":1}]}, \"synonyms\":{}}");

